<html>
  <style>
    body, h1, p {
      margin: 0;
    }

    body {
      width: 100vw;
      height: 100vh;
      display: grid;
      align-content: center;
      position: relative;
    }

    .building-container {
      position: relative;
      display: flex;
      flex-flow: column nowrap;
      align-items: center;
      gap: 54px;
    }

    @media only screen and (max-width: 600px) {
      body {
        align-content: start;
      }

      .building-container {
        gap: 16px;
        padding: 16px 0 0;
      }
    }

    .wheres-wally {
      width: 100%;
      height: auto;
      cursor: grab;
      background: linear-gradient(0deg, #CAE2FF 50%, rgba(204, 227, 255, 0) 100%)
    }

    h1 {
      letter-spacing: 0.8em;
      color: #000000;
      font-size: 48px;
      line-height: 200%;
      font-weight: bold;
      font-family: 'Montserrat', sans-serif;
      text-align: center;
    }

    p {
      font-family: 'Montserrat', sans-serif;
      font-size: 18px;
      line-height: 150%;
      letter-spacing: 1.9px;
      color: #000000;
      max-width: 475px;
      text-align: center;
    }

    
    @media only screen and (max-width: 600px) {
      h1 {
        letter-spacing: 0.8em;
        font-size: 24px;
      }

      p {
        font-size: 12px;
        padding: 0 16px;
      }
    }

    .controls-container {
      position: absolute;
      bottom: 32px;
      right: 28px;
      display: flex;
      flex-flow: column nowrap;
      align-items: end;
      gap: 18px;
    }

    .button {
      font-family: 'Montserrat', sans-serif;
      filter: drop-shadow(0px 6.31783px 12.6357px rgba(170, 213, 255, 0.5));
      background: #F4F4F4;
      border: 1px solid #000000;
      box-sizing: border-box;
      border-radius: 2.5px;
      height: 40px;
      cursor: pointer;
    }

    .button:hover {
      background: #cacaca;
    }

    .button:active {
      background: #a1a1a1;
    }

    .icon-button {
      width: 40px;
    }

    .reset-button {
      display: flex;
      flex-flow: row nowrap;
      align-items: center;
      justify-content: space-around;
      gap: 10px;
      padding: 0 12px;
    }

    .refresh-icon {
      width: 15px;
      height: 15px;
    }

    @media only screen and (max-width: 600px) {
      .controls-container {

        bottom: 24px;
        right: calc(50% - (120px / 2));
      }

      .reset-button {
        width: 120px;
      }

      .icon-button {
        display: none;
      }
    }

    .pinch-hint {
      display: flex;
      flex-flow: column nowrap;
      align-items: center;
      gap: 8px;
      margin-top: 16px;
    }

    .pinch-hint-text {
      font-family: 'Montserrat', sans-serif;
      font-weight: bold;
      font-size: 11px;
      line-height: 150%;
      letter-spacing: 1.9px;
      color: #000000;
    }
  </style>

    <script>
      const controls = document.getElementById('controls-container');
      const elem = document.getElementById('scene');

      const wally = Panzoom(elem, {
        maxScale: 30,
        minScale: 1,
        exclude: [controls]
      });
      elem.parentElement.addEventListener('wheel', wally.zoomWithWheel)

      document.getElementById('reset-button').addEventListener('click', function() {
        wally.reset();
      }, false);

      document.getElementById('bigger-button').addEventListener('click', function() {
        wally.zoomIn();
      }, false);

      document.getElementById('smaller-button').addEventListener('click', function() {
        wally.zoomOut();
      }, false);
    </script>
